import React from 'react';
import { List, Header } from "semantic-ui-react"


export const Garments = ({ garments }) => {
	return (
		<List>
			{garments.map(garment => {
				return(
					<List.Item key={garment.gtin}>
						<Header>{garment.gtin}</Header>
					</List.Item>
					)
			})}

		</List>

	)
}
